import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import { AboutPolaroid } from './about.png';

export default props => {
    return(
        <div>
            <Container>
                <Row>
                    <Col xs={12} sm={12} md={4} lg={4}>
                        <img src={AboutPolaroid} />
                    </Col>
                </Row>
            </Container>
        </div>
    );
}
